          <div class="w-full">
            <h4
              class="text-[#101828] font-primary text-[18px] font-medium pb-2"
            >
            How accurate are the email addresses returned in the Domain Search?
            </h4>
            <p class="text-[#475467] font-primary text-[16px]">
              The email addresses returned can have two different states:
Verified email address: we were able to recently validate the email address is valid. You can recognize these email addresses with the green Verified icon next to them.
Any other email address: these have not been fully verified recently, but are returned with a confidence score that evaluates the accuracy instead. This score considers all the signals we can get to provide a relevant evaluation (SMTP verifications, number and quality of sources, match with the most common pattern and other criteria). If relevant, a checkmark icon will let you manually trigger an email verification to get more insights.
            </p>
